import React from "react";
import './SideBar.scss';
import {Sidebar , Options} from "./Styled"
function SideBar() {
  var menu = $()
  return (
    <Sidebar>
      <Options href="#">
        Home
      </Options>
      <Options href="#">
        Artists
      </Options>
      <Options href="#" className='option'>Albums</Options>
      <Options href="#">Trends</Options>
      <Options href="#">Playlist</Options>
      <Options href="#">Profile</Options>
    </Sidebar>
  );
}

export default SideBar;
